class Solution {
public:
    int maxSum(vector<int> &nums1, vector<int> &nums2) {
        int n1 = (int) nums1.size(), n2 = (int) nums2.size(), p1 = 0, p2 = 0, ans = 0;
        long sum1 = 0, sum2 = 0;
        while (p1 < n1 && p2 < n2) {
            if (nums1[p1] > nums2[p2]) {
                sum2 += nums2[p2++];
            } else if (nums1[p1] < nums2[p2]) {
                sum1 += nums1[p1++];
            } else {
                ((ans += (int) (max(sum1, sum2) % 1000000007)) += nums1[p1]) %= 1000000007;
                sum1 = 0, sum2 = 0, p1++, p2++;
            }
        }
        while (p1 < n1) {
            sum1 += nums1[p1++];
        }
        while (p2 < n2) {
            sum2 += nums2[p2++];
        }
        return ((ans + (int) (max(sum1, sum2) % 1000000007)) % 1000000007);
    }
};

